import React from "react";

import The_Team from "./TheTeam/TheTeam";
import Match_Centre from "./MatchCentre/MatchCentre";
import Tickets_Membership from "./TicketsMembership/TicketsMembership";
import News from "./News/News";
import Merchandise from "./Merchandise/Merchandise";
import Community from "./Community/Community"

export default function Main() {
    return (
      <div className="Main">
        <h3>Main</h3>
        <TheTeam />
        <MatchCentre />
        <TicketsMembership />
        <News />
        <Merchandise />
        <Community />

      </div>
    )
  }
